#!/usr/bin/perl
use strict;
use warnings;
use Getopt::Long;
use lib '/eniq/home/dcuser/counters/lib';
use ENIQ::DataGeneration;
use File::Path;
use YAML::Tiny qw(Dump LoadFile);
use Carp;

my $usage = <<"USAGE";
 This script creates and populates LTE Bulk CM files with sample data.

 Usage:
        $0 [options]

    -d, --debug
                output debug information 
    -h, --help
                display this help and exit
    -v, --verbose
                output additional information 

 Example:
        $0 

 will create the Bulk CM files for all network elements.

USAGE

my $debug      	= '';
my $help       	= '';
my $verbose    	= '';  # default is off

GetOptions(
   'debug'        => \$debug,
   'help'         => \$help,
   'verbose'      => \$verbose,
);

if ($help) {
   print "$usage\n\n\n";
   exit;
}

set_debug() if $debug;

my ($node_type)          = $0 =~ m/generate_(\w+)_bulkcm_files/; # extract node type from calling script name
my $root_dir             = '/eniq/home/dcuser/ManagedObjects';
my @node_config_files    = get_configuration_info( root_dir => $root_dir, node_type => $node_type );

my %dispatch_table = (
   FDD       => \&get_bulk_cm_fdd,
   TDD       => \&get_bulk_cm_tdd,
   'FDD+TDD' => \&get_bulk_cm_fddtdd,
);

for my $node_config_file (@node_config_files) {
   my ($node) = $node_config_file =~ m{([^/]+).conf};
   debug("node : $node");

   my $config       = LoadFile( $node_config_file );
   my $current_time = get_current_time( timezone => $config->{timeZone}, date_format => '%Y%m%d%H%M%z' );
   my $bulkcm_dir   = "/eniq/data/pmdata/$config->{OSS_ID}/bulkcm/dir1";
   my $bulkcm_file  = "/tmp/AOM901122_R2EEU03_${node}_${current_time}_$config->{OSS_ID}_radio.xml";

   print "bulkcm_file = $bulkcm_file\n" if $debug;

   mkpath( $bulkcm_dir );   

   $current_time  = get_current_time( timezone => $config->{timeZone} ); # need different format for Bulk CM file

   open my $BULKCM_FH, '>', $bulkcm_file or croak "Cannot open file $bulkcm_file, $!";

   print {$BULKCM_FH} $dispatch_table{ $config->{CELL_TYPE} }->( 
      eNBId             => $node,
      timestampOfChange => $current_time,
      CONFIG            => $config,
   );

   close $BULKCM_FH or croak "Cannot close file $bulkcm_file, $!";

   system("/usr/bin/gzip $bulkcm_file && /bin/mv $bulkcm_file.gz $bulkcm_dir"); # must be zipped
}

